import React from 'react';
import './Services.css'; // Make sure to create this CSS file

const Services = () => {
    const services = [
        { name: 'Netflix', imgSrc: 'blob:https://web.whatsapp.com/f9761a11-4ced-41ce-91b2-e7950c425c33' },
        { name: 'Amazon', imgSrc: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQlQdN3penyZEVB9DGZ-nYdyOPVXXDVDbOYIg&s' },
        { name: 'Prime Video', imgSrc: 'blob:https://web.whatsapp.com/42c82855-1fae-48e9-b869-92d9c32fa8dc' },
        { name: 'Disney+ Hotstar', imgSrc: 'blob:https://web.whatsapp.com/e7efdc36-1a79-4dfc-b29b-dad0a6c9b4ff' },
    ];

    return (
        <div className="services-container">
            <h2>Services</h2>
            <div className="services-grid">
                {services.map((service, index) => (
                    <div className="service-card" key={index}>
                        <img src={service.imgSrc} alt={service.name} />
                        <a href={`/${service.name.toLowerCase()}`} className="service-link">
                            Click here
                        </a>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Services;
